def get_at(x, y, array, width):
    bit_index = (y * width) + x

    byte_index = bit_index // 8

    bit_of_byte = bit_index % 8

    target_byte = array[byte_index]

    target_bit = target_byte & (1 << (7 - bit_of_byte))

    # print(f"({x}, {y}): is stored in byte: {byte_index}, bit: {bit_of_byte} and has value: {bool(target_bit)}")

    return "1" if target_bit else "0"


